const companyDetails = {
    name: "Elegets Electronics",
    address: "Flat No: 102, Vishaka Valley Heights1, Veterinary Colony Opp MRO Office, Visakhapatnam, Andhra Pradesh-530040",
    website: "www.elegetselectronics.com",
    contactNumber: "+91 1234567890",
    email: "contact@elegetselectronics.com",
    logoBase64: "data:image/png;base64," // Replace with your Base64 encoded logo
};

function addProduct() {
    const productHTML = `
        <div class="product">
            <label for="productName">Product Name:</label>
            <input type="text" class="productName" required>
            <label for="productCost">Product Cost:</label>
            <input type="number" class="productCost" required>
            <label for="productQuantity">Product Quantity:</label>
            <input type="number" class="productQuantity" required>
        </div>
    `;
    document.getElementById('products').insertAdjacentHTML('beforeend', productHTML);
}

function generateBill() {
    const invoiceNumber = document.getElementById('invoiceNumber').value;
    const invoiceStatus = document.getElementById('invoiceStatus').value;
    const customerName = document.getElementById('customerName').value;
    const customerAddress = document.getElementById('customerAddress').value;
    const customerPhone = document.getElementById('customerPhone').value;
    const customerEmail = document.getElementById('customerEmail').value;
    const paymentStatus = document.getElementById('paymentStatus').value;

    const products = document.querySelectorAll('.product');
    let productDetails = '';
    let totalCost = 0;

    products.forEach((product) => {
        const productName = product.querySelector('.productName').value;
        const productCost = parseFloat(product.querySelector('.productCost').value);
        const productQuantity = parseInt(product.querySelector('.productQuantity').value);
        const cost = productCost * productQuantity;
        totalCost += cost;

        productDetails += `
            <tr>
                <td>${productName}</td>
                <td>${productCost.toFixed(2)}</td>
                <td>${productQuantity}</td>
                <td>${cost.toFixed(2)}</td>
            </tr>
        `;
    });

    const discount = parseFloat(document.getElementById('discount').value) || 0;
    const deliveryCharge = parseFloat(document.getElementById('deliveryCharge').value) || 0;

    const discountedCost = totalCost - (totalCost * discount / 100);
    const finalCost = discountedCost + deliveryCharge;

    const billHTML = `
        <div class="bill-header">
            <div class="company-details">
                <img src="${companyDetails.logoBase64}" alt="Company Logo">
                <h2>${companyDetails.name}</h2>
                <p><strong>Address:</strong> ${companyDetails.address}</p>
                <p><strong>Website:</strong> ${companyDetails.website}</p>
                <p><strong>Contact:</strong> ${companyDetails.contactNumber}</p>
                <p><strong>Email:</strong> ${companyDetails.email}</p>
            </div>
            <div class="customer-details">
                <h2>Bill To</h2>
                <p><strong>Name:</strong> ${customerName}</p>
                <p><strong>Address:</strong> ${customerAddress}</p>
                <p><strong>Phone:</strong> ${customerPhone}</p>
                <p><strong>Email:</strong> ${customerEmail}</p>
                <p><strong>Payment Status:</strong> <span class="payment-status">${paymentStatus}</span></p>
            </div>
        </div>
        <p><strong>Invoice Number:</strong> ${invoiceNumber}</p>
        <p><strong>Invoice Status:</strong> ${invoiceStatus}</p>
        <table class="bill-table">
            <thead>
                <tr>
                    <th>Product Name</th>
                    <th>Cost</th>
                    <th>Quantity</th>
                    <th>Total</th>
                </tr>
            </thead>
            <tbody>
                ${productDetails}
            </tbody>
        </table>
        <p class="total">Discount: ${(totalCost * discount / 100).toFixed(2)}</p>
        <p class="total">Delivery Charge: ${deliveryCharge.toFixed(2)}</p>
        <p class="total">Total Cost: ${totalCost.toFixed(2)}</p>
        <p class="total">Final Cost: ${finalCost.toFixed(2)}</p>
        <p class="terms">Terms & Instructions:</p>
        <p class="terms-details">1) Damaged or missing products must be accompanied by a proper unboxing video for return.<br>
        2) Damaged items are eligible for replacement only, not returns.</p>
        <p class="thanks">Thank you for shopping with us!</p>
    `;

    document.getElementById('bill').innerHTML = billHTML;
    document.getElementById('bill').style.display = 'block';
    document.getElementById('downloadBtn').style.display = 'block';
}

function downloadBill() {
    const element = document.getElementById('bill');
    const opt = {
        margin: [0.5, 0.5],
        filename: 'bill.pdf',
        image: { type: 'jpeg', quality: 0.98 },
        html2canvas: { scale: 2 },
        jsPDF: { unit: 'in', format: 'letter', orientation: 'portrait' }
    };

    html2pdf().from(element).set(opt).save();
}
